import React from 'react';
import {Link, Route, NavLink} from 'react-router-dom';
import Profile from './Profile';
import WithRouterSample from './WithRouterSample';


const Profiles = () => {
    return(
        <div>
            <h3>유저 목록 : </h3>
            <ul>
                <li>
                    <Link to="/profiles/velopert">velopert</Link>
                </li>
                <li>
                    <Link to="/profiles/gildong">gildong</Link>
                </li>
                <li>
                    <NavLink to="/profiles/velopert" activeStyle={{background: 'block', color: 'red'}}>velopert</NavLink>
                </li>
                <li>
                    <NavLink to="/profiles/gildong" activeStyle={{background: 'block', color: 'yellow'}}>gildong</NavLink>
                </li>
            </ul>

            <Route path="/profiles" exact render={() => <div>유저를 선택해주세요</div>}/>
            <Route path="/profiles/:username" component={Profile}/>
            <WithRouterSample/>
        </div>
    );
}

export default Profiles;
